import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  align-items: center;
  background-color: #6d758f;
  font-size: 20px;
  color: white;
  padding: 10px;
  cursor: pointer;
  border-radius: 10px;
  margin: 0 15px 20px;
  padding-left: 20px;

  font-size: 15px;
  font-weight: bold;
  color: #white;

  line-height: 36px;

  &:hover {
    color: white;
    background-color: #6D758F;
  }
`;
